INSERT INTO `community` (`created_at`, `id`, `modified_at`, `title`, `content`, `email`) VALUES ('2025-02-17 12:14:17', 5, '2025-02-17 12:14:17', '예쁜 은반지~', '반지가 정말 예쁜 것 같아서 한 번 사봤는데 어때요?\r\n\r\n# 은반지\r\n', 'seller1@test.com');
INSERT INTO `community` (`created_at`, `id`, `modified_at`, `title`, `content`, `email`) VALUES ('2025-02-17 12:18:29', 6, '2025-02-17 12:18:29', '이런 커플링은 어때요?', '요즘은 다양한 커플링이 있더라구요 \r\n\r\n은으로 된 것도 예쁘지만, 나무로 된 것도 색다르게 예쁘네요 ㅎㅎ\r\n\r\n#커플링\r\n', 'seller1@test.com');
INSERT INTO `community` (`created_at`, `id`, `modified_at`, `title`, `content`, `email`) VALUES ('2025-02-17 12:28:03', 7, '2025-01-27 12:28:03', '오늘은 쉬는 날~', '오늘은 쉬는 날~~\r\n\r\n금일부터 \r\n1주일 동안 휴가입니다', 'seller1@test.com');
INSERT INTO `community` (`created_at`, `id`, `modified_at`, `title`, `content`, `email`) VALUES ('2025-02-17 12:30:34', 8, '2025-02-17 12:30:34', '반지 추천 !', '생각보다 다양한 반지들이 있네요\r\n\r\n탄생석 반지도 있고, 각인 반지도 있고\r\n여러분들은 어떤 반지가 마음에 드시나요?', 'seller1@test.com');
INSERT INTO `community` (`created_at`, `id`, `modified_at`, `title`, `content`, `email`) VALUES ('2025-02-17 12:34:58', 9, '2025-02-17 12:34:58', '예쁜 귀고리도 있어요!', '요즘은 심플한 게 유행인 것 같아요\r\n\r\n무난하면서도 정말 예쁘죠?', 'seller1@test.com');
INSERT INTO `community` (`created_at`, `id`, `modified_at`, `title`, `content`, `email`) VALUES ('2025-02-17 12:37:44', 10, '2025-02-17 12:37:44', '실리콘 귀고리!', '착용감도 좋고 보기에도 좋은 귀고리네요', 'seller1@test.com');
INSERT INTO `community` (`created_at`, `id`, `modified_at`, `title`, `content`, `email`) VALUES ('2025-02-17 12:53:55', 11, '2025-02-17 12:53:55', '십자가 목걸이~', '많은 목걸이들이 있지만 제 최애 목걸이는 이거예요~\r\n\r\n다양한 코디에 무난하게 어울리는 목걸이라서 제가 자주 착용하게 되는 것 같아요ㅎㅎ', 'seller1@test.com');
INSERT INTO `community` (`created_at`, `id`, `modified_at`, `title`, `content`, `email`) VALUES ('2025-02-17 12:59:49', 12, '2025-02-17 12:59:49', 'BEST🏆 925silver영롱한 별빛 데일리 귀걸이~', '별 빛이 내리는 귀걸이~\r\n\r\n별 귀걸이랑, 십자가 귀걸이 보면서 \r\n뭐 살까하다가 별 빛 감성 보이는 귀걸이로 사보았어요~\r\n\r\n다음에는 착장까지 해서 올려볼게용', 'seller1@test.com');
INSERT INTO `community` (`created_at`, `id`, `modified_at`, `title`, `content`, `email`) VALUES ('2025-02-17 13:03:07', 13, '2025-02-17 13:03:07', '전통 무늬 팔찌!!', '전통 무늬 팔찌라고 해서 한번 착용해봤는데, 생각보다 다양하게 맞춰서 껴볼 수 있을 것 같아요\r\n색도 다양해서 어디든 어울리게 착용할 수 있을 것 같네요 ㅎㅎ', 'seller1@test.com');
INSERT INTO `community` (`created_at`, `id`, `modified_at`, `title`, `content`, `email`) VALUES ('2025-02-17 13:06:34', 14, '2025-02-17 13:06:34', '커플 팔찌~', '실버 팔찌\r\n\r\n요즘은 반지 말고 이런 커플 팔찌도 많이 하더라구요\r\n이렇게 착용해보니까 생각보다 예쁜 것 같기도?', 'seller1@test.com');
INSERT INTO `community` (`created_at`, `id`, `modified_at`, `title`, `content`, `email`) VALUES ('2025-02-17 13:10:33', 15, '2025-02-17 13:10:33', '미엘 그레이 롱 허리치마', '미엘 그레이 통 허리치마\r\n\r\n심플하면서도 고급스러운 이미지에 한복인데\r\n저한테 잘 어울릴지 고민이 많이 되네요ㅠ\r\n', 'seller2@test.com');
INSERT INTO `community` (`created_at`, `id`, `modified_at`, `title`, `content`, `email`) VALUES ('2025-02-17 13:19:32', 16, '2025-02-17 13:19:32', '생활 한복', '생활 한복인데 예쁘게 나온 것 같아요~\r\n\r\n요즘 이런 생활 한복도 예쁜 것 같아요ㅎㅎ', 'seller2@test.com');
INSERT INTO `community` (`created_at`, `id`, `modified_at`, `title`, `content`, `email`) VALUES ('2025-02-17 13:23:00', 17, '2025-02-17 13:23:00', '뽀글이 양면 자켓', '양털 자켓!\r\n\r\n집에서 입기도 좋고,\r\n밖에서도 입기 편한\r\n\r\n요즘 날씨와 아주 잘 어울리는 자켓인 것 같아요 ㅎㅎㅎ\r\n', 'seller2@test.com');
INSERT INTO `community` (`created_at`, `id`, `modified_at`, `title`, `content`, `email`) VALUES ('2025-02-17 14:17:54', 18, '2025-02-17 14:17:54', '귀멸의 칼날!!', '요즘 귀멸의 칼날에 빠져서 다 챙겨보고 있는데\r\n\r\n이런 신발도 있네요~~\r\n진짜 이쁜 것 같아용', 'seller2@test.com');
INSERT INTO `community` (`created_at`, `id`, `modified_at`, `title`, `content`, `email`) VALUES ('2025-02-17 14:20:57', 19, '2025-02-17 14:20:57', '이런 돈 봉투는 어때요?', '설을 지낼 때 부모님께 드렸던 봉투인데\r\n고급지면서 예쁜 느낌이라 샀었는데 부모님도 정말 좋아하셨어요\r\n이렇게 예쁜 돈 봉투는 처음이라고 하시면서 말이에요 ㅎㅎ\r\n', 'seller2@test.com');
INSERT INTO `community` (`created_at`, `id`, `modified_at`, `title`, `content`, `email`) VALUES ('2025-02-17 14:27:35', 20, '2025-02-17 14:27:35', '수제 구두', '요즘 이렇게 예쁜 수제 구두들도 많이 있는데 한번 구매해보시는 건 어때요?', 'seller2@test.com');
INSERT INTO `community` (`created_at`, `id`, `modified_at`, `title`, `content`, `email`) VALUES ('2025-02-17 14:32:55', 21, '2025-02-17 14:32:55', '꽃 신~', '1년 6개월 길었지만 기다렸더니 이렇게 예쁜 꽃신 선물 받았어요 ㅎㅎ', 'seller2@test.com');
INSERT INTO `community` (`created_at`, `id`, `modified_at`, `title`, `content`, `email`) VALUES ('2025-02-17 14:45:52', 22, '2025-02-17 14:45:52', '예쁜 엽서', '요즘 핸드메이드 엽서는 이렇게 예쁘네용', 'seller2@test.com');
INSERT INTO `community` (`created_at`, `id`, `modified_at`, `title`, `content`, `email`) VALUES ('2025-02-17 14:48:21', 23, '2025-02-17 14:48:21', '이불 밖은 위험해..', '이런 날씨는 집이 최고야', 'seller2@test.com');
